pragma solidity^0.4.17;

contract Ballot{

    struct Voter{
        uint weight;
        bool voted;
        address delegate;
        uint vote;
    }
    struct Proposal{
        bytes32 name;
        uint voteCount;
    }

    address public chairperson;

    mapping(address => Voter) public voters;

    Proposal[] public proposals;

    function Ballot(bytes32 proposalNames) public{
        chairperson = msg.sender;
        voters[chairperson].weight = 1;

        for(uint i=0; i< proposalNames.length; i++){
            proposals.push(Proposal({
                name: proposalNames[i],
                voteCount: 0
            }));
        }
    }

    function giveRightToVote(address voter) private {
    require((msg.sender == chairperson) && !voters[voter].voted && (voters[voter].weight == 0));
    voters[voter].weight = 1;

    }

    function Vote(uint proposal) public {

        Voter storage sender = voters[msg.sender];
        require(!sender.voted);
        sender.voted = true;
        sender.vote = proposal;
        proposals[proposal].voteCount = sender.weight;

    }

    function Printall() public constant returns (uint Printall){
        if(proposals.length >=1){
          Printall = proposals[2].voteCount;
        }
        else{
          Printall = 88;
        }

    }


    function winningProposal() public constant returns (uint winningProposal)  {
        uint winningVoteCount = 0;
        for(uint p=0; p<proposals.length; p++){
            if(proposals[p].voteCount > winningVoteCount){
                winningVoteCount = proposals[p].voteCount;
                winningProposal = p;
            }
        }

    }

    function winnerName() public constant returns (bytes32 winnerName){
        winnerName = proposals[winningProposal()].name;
    }
}
